import {React, useState} from 'react';
const initialValue = {
    defaultVND: '10000000',
    defaultUSD:'',
    changeRate:'23300'
}
const Income = () =>{
    const [defaultValue, setDefaultValue] = useState(initialValue);
    return(
        <section>
            <h4>Income</h4>
            <div>
                <label>VND:</label>
                <input type='text' value={defaultValue.defaultVND}/>
                <label>USD</label>
                <input type='text' value={defaultValue.defaultUSD}/>
                <label>Exchange rate: 1 USD =</label>
                <input type='text' value={defaultValue.changeRate}/>
                <label>VND</label>
            </div>
        </section>
    )
}

export default Income;
